import React from 'react'
import Context from './context/Provider';



export default function Coins(props) {
  return (
      <Context.Consumer>
       {({coinList}) => {
         if(!coinList) {
           return <div>
           Cargando Monedas
         </div>
         } else{
           <div>
             {props.children}
           </div>
         }
       }}
      </Context.Consumer>
    )
}
